from collections import Counter

def strange_coach(players):
    return ''.join(
                  sorted(i for i,j in
                          Counter(map(lambda x: x[0], players)).most_common()
                              if j >= 5)) or 'forfeit'

def strange_coach(players):
  d = {l:0 for l in map(chr, range(97, 123))}

  for i in players:
      d[i[0]] += 1

  r = "".join(sorted(x for x in d if d[x] > 4))
  return r if r != "" else "forfeit"

def strange_coach(players):
    firsts = [player[0] for player in players]
    return "".join(sorted(c for c in set(firsts) if firsts.count(c) >= 5)) or "forfeit"

from itertools import groupby

def strange_coach(players):
  return "".join(key for key, group in groupby(sorted(players), lambda x: x[0]) if len(list(group)) >= 5) or "forfeit"

